import React from 'react';
import { Table } from 'reactstrap';

const TableRow = (user) => {
    return (
        <tr>
            <td>
                2
            </td>
            <td className="pa3 bb b--black-10">
                {user.name}
            </td>
            <td className="pa3 bb b--black-10">
                {user.email}
            </td>
            <td className="pa3 bb b--black-10">
                {user.color}
            </td>
        </tr>
    )
}
export default TableRow;
